window.bookSummaryJSON = "<p><b>All Violet Parker wants is a day off. Better yet, just a “normal” day. But things never go as planned, especially in Deadwood</b>.</p> <p>Someone - or rather something - broke into the local taxidermy shop and took bites out of the critter displays before racing off into the dark. But this is no random crime, and Violet knows it. With a bounty on her head and troublemakers zeroing in on her, she soon goes from being the hunter to the hunted.</p> <p>“Burly muscled and rawhide tough don’t matter. Never tangle with a <i>Scharfrichter</i>!” - Violet Parker</p>"; 
